import { securitiesHiRisk } from "./data";
import useExchange from "./useExchange";

const SecuritiesHiRiskExchange = () => {
  const rates = useExchange();
  const securitiesHiRiskAmount = (1 / rates.EUR) * securitiesHiRisk.amount;
  return securitiesHiRiskAmount;
};

export default SecuritiesHiRiskExchange;
